INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'At animi minus tenetur ut.', 'Maiores nihil mollitia adipisci ipsum. Fugiat quidem id laborum iste voluptas blanditiis. Unde non aspernatur et rem nulla. Eveniet blanditiis omnis in eius sunt dicta ut accusamus. Placeat tempora cupiditate cumque ut.', 'Ut iste reprehenderit et tempore. Magni tenetur atque modi quibusdam. Ab odit ut sit sapiente voluptas molestias ut. Ea molestias delectus dolores est voluptas.', '2007-07-12');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Adipisci in vero minus voluptas consectetur id.', 'Iure architecto est animi nisi neque voluptatem enim. Beatae debitis vero architecto a temporibus dolor distinctio. Laudantium et voluptates accusantium quae eos. Est doloribus repudiandae ut natus quisquam facere. Beatae enim aspernatur ratione velit.', 'Enim molestiae blanditiis eum aut aut rerum temporibus assumenda. Perspiciatis omnis dignissimos eius quis. Quo rerum debitis non et qui.', '1995-06-10');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Non aut autem et commodi sapiente.', 'Laborum praesentium nesciunt modi enim. Ut qui velit corporis.', 'Qui qui sit maiores consequatur harum et dolor. Rerum non odit dolores aliquam et. Delectus natus ea est eius atque repudiandae. Molestias quia quis sit quis.', '1998-06-25');
